'use strict';

/**
* Image of an airplane, viewed from above looking down, as a `buffer` object.
*
* @module @stdlib/datasets/airplane-from-above
*
* @example
* var image = require( '@stdlib/datasets/img-airplane-from-above' );
*
* var img = image();
* // returns <Buffer>
*/

// MODULES //

var IS_BROWSER = require( '@stdlib/assert/is-browser' );


// MAIN //

var image;
if ( IS_BROWSER ) {
	image = require( './browser.js' );
} else {
	image = require( './airplane_from_above.js' );
}


// EXPORTS //

module.exports = image;
